export const ROUTES = {
    // [개인회원, 기업회원] 메인
    MAIN: {
        path: "/",
        name: "Main",
    },
    // [서비스관리자, 인프라관리자] 메인
    ADMIN_MAIN: {
        path: "/admin",
        name: "AdminMain",
    },
    // [개인회원] 채용공고 메뉴 선택
    JOB_MENU: {
        path: "/jobs/menu",
        name: "JobMenu",
    },
    // [개인회원] 지원 현황
    JOB_APPLICATION_STATUS: {
        path: "/jobs/application-status",
        name: "JobApplicationStatus",
    },
    // [개인회원] 교육 현황
    EDUCATION_STATUS: {
        path: "/education-status",
        name: "EducationStatus",
    },
    // [개인회원] 이력서
    RESUME_PAGE: {
        path: "/resume",
        name: "ResumePage",
    },
    // [개인회원] 개인 정보
    INDIVIDUAL_USER_PROFILE: {
        path: "/individual-user/profile",
        name: "IndividualUserProfile",
    },
    // [개인회원, 기업회원] 로그인
    LOGIN_VIEW: {
        path: "/login",
        name: "LoginView",
    },
    // [개인회원] 회원가입
    INDIVIDUAL_USER_REGISTER_VIEW: {
        path: "/individual-user/register",
        name: "IndividualUserRegisterView",
    },
    // [기업회원] 회원가입
    CORPORATE_USER_REGISTER_VIEW: {
        path: "/corporate-user/register",
        name: "CorporateResisterView",
    },
    // [개인회원] 우바고도
    WOORIBOUND_ELEVATION_INFO: {
        path: "/wooribound-elevation",
        name: "WooriboundElevationInfo",
    },
    // [개인회원] 교육현황
    EDUCATION_APPLICATION: {
        path: "/education/application",
        name: "EducationApplication",
    }
};
